function callModal() {
    $('#docNameModal').modal('toggle');
}

function giveFileName() {
    let element = document.getElementById('company-txt').value;
    doc.save('cotización-' + element + getDateTime());
}

function getDateTime() {
    let today = new Date();

    let day = today.getDate();
    let month = today.getMonth() + 1;
    let year = today.getFullYear();

    let hour = today.getHours();
    let minutes = today.getMinutes();
    let seconds = today.getSeconds();

    if (day < 10)
        day = '0' + day;

    if (month < 10)
        month = '0' + month;

    if (hour < 10)
        hour = '0' + hour;

    if (minutes < 10)
        minutes = '0' + minutes;

    if (seconds < 10)
        seconds = '0' + seconds;

    return today = day + '/' + month + '/' + year + '/' + hour + ':' + minutes + ':' + seconds;
}

function addRow(e) {
    e.preventDefault();
    var product = document.getElementById('productTxt').value;
    var price = document.getElementById('priceTxt').value;
    if (product.trim().length > 0 && price.trim().length > 0) {
        $('#btn-download').removeClass('d-none');
        const classesRow = ['row', 'justify-content-center', 'py-2'];
        const classesProduct = ['col-xl-7', 'col-lg-7', 'col-md-7', 'col-sm-7', 'col-7'];
        const classesPrice = ['col-xl-5', 'col-lg-5', 'col-md-5', 'col-sm-5', 'col-5'];

        var row = document.createElement('div');
        var colProduct = document.createElement('div');
        var colPrice = document.createElement('div');
        var deleteBtn = document.createElement('IMG');

        row.setAttribute('id', 'row-' + idRow);

        colProduct.setAttribute('id', 'product-' + idRow);

        colPrice.setAttribute('id', 'price-' + idRow);

        deleteBtn.setAttribute('alt', 'eliminar');
        deleteBtn.setAttribute('src', 'images/delete.png');
        deleteBtn.setAttribute('width', '32');
        deleteBtn.style.cssText = 'padding-left:10px;cursor: pointer;';
        deleteBtn.onclick = function (event) {
            $(this).parent('div').parent('div').remove();
        };

        classesRow.forEach(element => {
            row.className += element + ' ';
        });

        classesProduct.forEach(element => {
            colProduct.className += element + ' ';
        });

        classesPrice.forEach(element => {
            colPrice.className += element + ' ';
        });

        let product = document.getElementById('productTxt').value;
        let price = document.getElementById('priceTxt').value;

        colProduct.innerText = product;
        colPrice.innerText = price;

        document.getElementById('row-to-append').appendChild(row);
        document.getElementById('row-' + idRow).appendChild(colPrice);

        colPrice.appendChild(deleteBtn);

        var priceRef = document.getElementById('price-' + idRow);
        insertBefore(colProduct, priceRef);
        idRow++;

        product = '';
        price = '';
    } else {
        if (product.trim().length == 0) {
            $('#alert-error').collapse('show');
        } else if (price.trim().length == 0) {
            $('#alert-error').collapse('show');
        }
    }

}

function closeAlert() {
    $('#alert-error').collapse('hide');
}

function insertBefore(el, referenceNode) {
    referenceNode.parentNode.insertBefore(el, referenceNode);
}

function onlyNumbers(e) {
    if (e.which !== 8 && e.which !== 0 && e.which !== 190 && (e.which < 48 || e.which > 57)) {
        e.preventDefault();
        return false;
    }
    e.target.value = e.target.value.replace(/[^0-9.]/g, '').replace(/(\..*)\./g, '$1');
}